sys_variable_value.value:
(function execute(inputs, outputs) {
    
    var api = new x_neyu_modtrak.ModTrakAPI();

    const response = api.create(
        inputs.requestor,
        inputs.applicationName,
        inputs.applicationFunction,
        inputs.subject,
        inputs.status,
        inputs.description,
        inputs.reasonForChange,
        inputs.changeType,
        inputs.priority,
        inputs.refNumber,
        inputs.requestDate,
        inputs.requestedDueDate,
        inputs.department,
        inputs.workflowFlag,
        inputs.deptApprover,
        inputs.deptApprDate,
        inputs.workStartedDate,
        inputs.completeDate,
        inputs.infoTechApprover,
        inputs.infoTechApprDate
    );

    outputs.error = response.error;
    outputs.error_message = response.errorMessage;
    outputs.modtrak_number = response.result;
    outputs.status = response.status;

})(inputs, outputs);

